export async function getPetData() {
    try {
        const response=await fetch('http://localhost:8000')
        const results=await response.json()


        // return (
        //  {       success: true,
        //         results: mapedResults}
        // )
        return results
    } catch (error) {
        console.log(error);
    }
}
